const $audio = document.getElementById('audio'),
      $gameBoard = document.getElementById('board'),
      $score = document.getElementById('score'),
      $timer = document.getElementById('timer'),
      $steps = document.getElementById('steps'),
      $startButton = document.getElementById('restart'),
      animalArray = [
          { 
              answer: 'lion',
              image: "data:image/jpeg;base64,"
           },

           { 
            answer: 'monkey',
            image: "data:image/jpeg;base64,"
         },
         { 
            answer: 'tiger',
            image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTz5OS6MiDIvskz--DNRl2CgmX9dcTefL7u8w&usqp=CAU"
         },
         { 
            answer: 'owl',
            image: "data:image/jpeg;base64,"
         },
         { 
            answer: 'elephant',
            image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQM-UGgBokhL-MNKE7QIpkgFtFdXvL9sfbt1g&usqp=CAU"
         },
         { 
            answer: 'bear',
            image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQXJNkq8pNpd8GNsZHGFdcU4EgWNwSJQgO7mg&usqp=CAU"
         }];

const soundsUrls = {
    correct: 'https://s3-us-west-2.amazonaws.com/s.cdpn.io/250758/rightanswer.mp3'
        }

let timer = 40,
    steps = 0,
    score = 3,
    selection = [],
    timeFunc;

const shuffle = (array) => {
        let counter = array.length;
        while (counter > 0) {
          let index = Math.floor(Math.random() * counter);
          counter --;
          let temp = array[counter];
          array[counter] = array[index];
          array[index] = temp;
        }
        return array;
    }

const countTime = () => {

    timeFunc =  setInterval(() => {
        timer--;
        $timer.innerText = timer;    
        if(timer === 0) {
            clearInterval(timeFunc);
            Swal.fire({
                // icon: 'error',
                title: 'Game Over',
                text: 'Time is over, Try again',
                showCancelButton: true,
                showConfirmButton: true,
                confirmButtonText: 'OK',
                    imageUrl: 'data:image/jpeg;base64,',
                imageWidth: 300,
                imageHeight: 200,

            }).then((result) => {
                console.log(result.isConfirmed);
                if (result.isConfirmed) {
                    startGame();
                }
            });
        }
        }, 1000);

    }

const countSteps = () => {
    steps++;
    $steps.innerText = steps;
    calcScore();
}

const checkGameState = () => {
    const openCards = (document.getElementsByClassName('open')).length;   
    console.log(openCards);
    if (openCards === (animalArray.length * 2)) {
        clearInterval(timeFunc);
        Swal.fire({
            position: 'center',
            title: 'Good Job',
            confirmButtonText: 'Start again',
            showConfirmButton: true,
            showCancelButton: true,
             imageUrl: 'data:image/jpeg;base64,',
    imageWidth: 300,
    imageHeight: 200,
          }).then((result) => {
            console.log(result.isConfirmed);
            if (result.isConfirmed) {
                startGame();
            }
        });
    }
}

const calcScore = () => {
    const rating3 = animalArray.length + 2,
      rating2 = (animalArray.length * 2);
    //   rating1 = (cards.length * 3);

      const is3Stars = steps <= rating3,
            is2Stars = steps > rating3 && steps <=rating2,
            is1Stars = steps > rating2;

    if (is3Stars) {
        score = 3;
    }
    if (is2Stars) {
        score = 2;
    }
    if (is1Stars) {
        score = 1;
    }

    $score.innerText = score;
}

const printCards = (array) => {
    $gameBoard.innerHTML="";
    const shuffleArray = shuffle([...array, ...array]);
    shuffleArray.forEach(card => {
        const liElement = document.createElement('li');
        liElement.dataset.answer = card.answer;
        const imgElement = document.createElement('img');
        imgElement.src = card.image;
        imgElement.alt = card.answer;
        liElement.appendChild(imgElement);
        $gameBoard.appendChild(liElement);

    });

}

const initialValues = () => {
    clearInterval(timeFunc);
    selection = [];
    timer = 40;
    $timer.innerText = timer;
    score =3;
    $score.innerText = score;
    steps = 0;
    $steps.innerText = steps;
}
    
const startGame = () => {
        printCards(animalArray);
        initialValues();
        countTime();
    }


const flipCards = (isCorrect) => {
    setTimeout(() => {
        const flippedCards = Array.from(document.getElementsByClassName('flip'));   
        flippedCards.forEach((card) => {
            if (isCorrect) {
                card.classList.replace('flip','open');      
            }else {
                card.classList.remove('flip');
                }
            }
        )}, 800);
} 

const selectedAnswer = ($event) => {
    const isLiElement = $event.target.localName === 'li';

    if (!isLiElement ||  $event.target.classList.contains('flip') ||  $event.target.classList.contains('open')) {
        return false;
    }

        const currentAnswer = $event.target.dataset.answer;
        $event.target.classList.add('flip');
        selection.push(currentAnswer);
        
        if(selection.length === 2) {
            $gameBoard.classList.add('compare');
            const isSame = selection[0] === selection[1];
            if (isSame) {
                $audio.src = soundsUrls.correct;
                $audio.play();
            }
            flipCards(isSame);
            countSteps();
            selection= [];
            setTimeout(()=>{
                checkGameState();
                $gameBoard.classList.remove('compare');
            },900)
        }

        
    

}


printCards(animalArray);

Swal.fire({
    title: 'Hello',
    text: 'Do you want to play?',
    confirmButtonText: 'Go',
    showDenyButton: true,
    denyButtonText: `No`,
    imageUrl: 'data:image/jpeg;base64,',
    imageWidth: 200,
    imageHeight: 200,
    imageAlt: 'Custom image',
  }).then((result) => {
      console.log(result.isConfirmed);
      if (result.isConfirmed) {
          startGame();
      }
  })




$gameBoard.addEventListener('click', selectedAnswer);

$startButton.addEventListener('click', startGame);

